import "./App.css";

import Heading from "./Heading";

function List() {
  return (
    <ul>
      <li>Bengaluru</li>
      <li>Mumbai</li>
      <li>Delhi</li>
    </ul>
  );
}

function App() {
  return (
    <div>
      <Heading />
      <List />
    </div>
  );
}

export default App;
